/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_npwpd` AS select `identitas_perusahaan`.`npwpd_perusahaan` AS `npwpd_perusahaan` from (((((((((`identitas_perusahaan` join `sptpd_restoran` on((`identitas_perusahaan`.`npwpd_perusahaan` = convert(`sptpd_restoran`.`npwpd` using utf8)))) join `sptpd_reklame` on((`identitas_perusahaan`.`npwpd_perusahaan` = convert(`sptpd_reklame`.`npwpd` using utf8)))) join `sptpd_parkir` on((`identitas_perusahaan`.`npwpd_perusahaan` = convert(`sptpd_parkir`.`npwpd` using utf8)))) join `sptpd_listrik` on((`identitas_perusahaan`.`npwpd_perusahaan` = convert(`sptpd_listrik`.`npwpd` using utf8)))) join `sptpd_hotel` on((`identitas_perusahaan`.`npwpd_perusahaan` = convert(`sptpd_hotel`.`npwpd` using utf8)))) join `sptpd_hiburan` on((`identitas_perusahaan`.`npwpd_perusahaan` = convert(`sptpd_hiburan`.`npwpd` using utf8)))) join `sptpd_galianc` on((`identitas_perusahaan`.`npwpd_perusahaan` = convert(`sptpd_galianc`.`npwpd` using utf8)))) join `sptpd_burung_walet` on((`identitas_perusahaan`.`npwpd_perusahaan` = convert(`sptpd_burung_walet`.`npwpd` using utf8)))) join `sptpd_air_bawah_tanah` on((`identitas_perusahaan`.`npwpd_perusahaan` = convert(`sptpd_air_bawah_tanah`.`npwpd` using utf8)))) */;

