/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_perusahaan` AS select `identitas_pemilik`.`npwpd_pemilik` AS `npwpd_pemilik`,`identitas_pemilik`.`nama_pemilik` AS `nama_pemilik`,`identitas_pemilik`.`alamat_pemilik` AS `alamat_pemilik`,`identitas_pemilik`.`hp` AS `hp`,`identitas_perusahaan`.`npwpd_perusahaan` AS `npwpd_perusahaan`,`identitas_perusahaan`.`nama_perusahaan` AS `nama_perusahaan`,`identitas_perusahaan`.`alamat_perusahaan` AS `alamat_perusahaan`,`identitas_perusahaan`.`telp` AS `telp`,`master_sptpd`.`nama_sptpd` AS `nama_sptpd` from ((`identitas_pemilik` join `identitas_perusahaan` on((convert(`identitas_pemilik`.`npwpd_pemilik` using utf8) = `identitas_perusahaan`.`npwpd_pemilik`))) join `master_sptpd` on((`identitas_perusahaan`.`jenis_usaha` = `master_sptpd`.`id`))) */;

